Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "La République fédérale de Yougoslavie (YOUGOSLAVIE) a changé son nom en Serbie et Monténégro le 4 février 2003. Le Montenegro s'est ensuite détaché de la Fédération le 3 juin 2006, laissant la République de Serbie se déclarer peu après le successeur légal de l'ancien Etat de Serbie et Montenegro.", language_id: (Language.find_by name: 'fr').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Название Федеративной Республики Югославия (ЮГОСЛАВИЯ) было изменено на \"Сербия и Черногория\" 4 февраля 2003 года. ,Черногория объявила о своем выходе из союза с Сербией с 3 июня 2006 года и объявила себя правопреемником государственного союза Сербии и Черногории.", language_id: (Language.find_by name: 'ru').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "La República Federal de Yugoslavia (YUGOSLAVIA), cambió su nombre a Serbia y Montenegro el 4 de febrero de 2003. Montenegro se separó de la federación el 3 de junio de 2006, dejando la República de Serbia, poco después, para declararse sucesor legal del Unión de los Estados de Serbia y Montenegro.", language_id: (Language.find_by name: 'es').id])
